import React, { Component } from 'react';
import Carousel from 'react-bootstrap/Carousel'

import Pic1 from '../img/NY17.jpeg'
import Pic2 from '../img/NY18.jpeg'
import Pic3 from '../img/NY19.jpeg'

import RealCarousel from './RealCarousel'

class CarouselPage extends Component {
    constructor(props){
        super(props);
    }

    render(){
        console.log(Pic1)
        return (
            <Carousel style={{height:"100%"}}>
                <Carousel.Item>
                    <img
                    className="d-block w-100"
                    src={Pic1}
                    alt="Pic1"
                    style={{maxHeight:"80vh"}}
                    />
                    <Carousel.Caption>
                    <h3>Pic1</h3>
                    <p>Pic1</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <RealCarousel 
                src={Pic1}
                alt="New York 17"
                title="New York 17"
                text="This is a picture test"
                />
                <RealCarousel 
                src={Pic2}
                alt="New York 18"
                title="New York 18"
                text="This is a picture test"
                />
                <RealCarousel 
                src={Pic3}
                alt="New York 19"
                title="New York 19"
                text="This is a picture test"
                />
            </Carousel>
        );
    }
};

export default CarouselPage;
